import CssBaseline from "@material-ui/core/CssBaseline";
import PrimarySearchAppBar from './components/main_nav_bar'
import LoginSearchAppBar from './components/main_nav_bar_home'


function App() {
  return (
    <div className="App">
      <ThemeProvider>
      {/* <PrimarySearchAppBar/> */}
      <LoginSearchAppBar/>
      </ThemeProvider>

    </div>
  );
}

export default App;
